Ny Salamo Salamo toko 102 Vavaka sy fanantenan'Israely tra-pahoriana. 1Vavaky ny ory, mivesa-pahoriana, sy mandoatra ny fitarainany eo anatrehan'ny Tompo. 2Iaveh, henoy ny fivavahako, 3ary aoka ho tonga hatrany aminao ny fitarainako. Aza manafina ny tavanao amin'ny andron'ny fahoriako, atongilano aty amiko ny sofinao, faingàna hamaly ahy, nony mitaraina aho. 4Fa levona toy ny lasan-ko setroka ny androko, ary mirehitra, toy ny doran'ny afo, ny taolako. 5Voajinja toy ny ahitra ny foko, ka malazo; 
..........
ia lalain'ny mpanomponao ny vatony, nampangoraka ny fony hatramin'ny vovo-taniny. 16Amin'izay dia hanaja ny anaran'ny Tompo ny firenena, ary hanaja ny fiandriananao ny mpanjaka rehetra amin'ny tany. 17Fa Iaveh nanangana an'i Siona indray, niseho tamin'ny voninahiny izy; 18nihaino ny vavaky ny fadiranovana, tsy nanamavo ny fitarainany. 19Aoka hatao an-tsoratra izany, ho an'ny taranaka ho avy; ary aoka hankalazain'ny firenena vao hiforona Iaveh. 20Satria nitsinjo teny amin'ny havoany masina izy, s
